const shareCode = async ({ code, language }) => {
  const backendHostUrl = getBackendHost();
  const url = `${backendHostUrl}/api/v1/share`;
  const browserCookieId = getCookie(const_browserId);
  const userAgent = navigator.userAgent;

  const data = {
    code,
    language,
    shared_by: browserCookieId,
    user_agent: userAgent,
  };

  const response = await fetch(url, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(data),
  });
  return response.json();
};

const saveCode = async ({ browserId, code, sessionId, language }) => {
  try {
    const backendHostUrl = getBackendHost();
    const url = `${backendHostUrl}/api/v1/code`;
    const userAgent = navigator.userAgent;
    let browserCookieId = getCookie(browserId);

    if (!browserCookieId) {
      browserCookieId = generateUUID();
      setCookie(browserId, browserCookieId, 365);
    }

    const payload = {
      user_id: browserCookieId,
      session_id: sessionId,
      code,
      user_agent: userAgent,
      language,
    };

    const response = await fetch(url, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(payload),
    });

    return response.json();
  } catch (error) {
    // Do-Nothing
  }
};

