let modalCanceled = false;

const animateProgressBar = ({ code, language }) => {
  modalCanceled = false;

  // Start the progress bar animation
  const progressBarAnimation = new Promise((resolve) => {
    $('.progress')
      .css('width', '0%')
      .animate(
        {
          width: '100%',
        },
        900,
        function () {
          resolve();
        },
      );
  });

  // Make the API call to get share id
  const shareCodeRequest = shareCode({ code, language });

  // Wait for both the animation and the API call to complete
  Promise.all([progressBarAnimation, shareCodeRequest])
    // eslint-disable-next-line no-unused-vars
    .then(([_, res]) => {
      if (modalCanceled) {
        return; // If the modal was canceled, do not proceed
      }

      if (!res.share_id) {
        resetProgressBar();

        // Hide the share link generating modal
        $('.share-link-generating-modal').hide();

        showNotification('Failed to generate link.', 'error');
        return;
      }

      const newShareUrl = getNewShareUrl(res.share_id);

      createSocialShareButtons(newShareUrl, 'I just wrote this program on Programiz Online Compiler.');

      // Hide the share link generating modal
      $('.share-link-generating-modal').hide();

      // Set the value of the share link and show the modal
      $('.share-code-value').val(newShareUrl);
      $('.share-link-modal .modal-content').removeClass('hidden');
      $('.share-code-copy-btn').css('display', 'inline-block');
      $('.code-copied-success').css('display', 'none');
      $('.share-link-modal').show();
    })
    .catch(() => {
      if (!modalCanceled) {
        resetProgressBar();

        $('.share-link-generating-modal').hide();

        showNotification('Failed to generate link.', 'error');
      }
    });
};

const resetProgressBar = () => {
  modalCanceled = true;
  $('.progress').stop(true, true).css('width', '0%');
  $('.share-link-generating-modal').hide();
};

