function getRunnableClass(javaCode) {
  const lines = javaCode.split('\n');
  let inMultilineComment = false;
  let runnableClasses = [];
  let error = null;

  for (let line of lines) {
    line = line.trim();

    // Check if we're in a multi-line comment
    if (inMultilineComment) {
      if (line.includes('*/')) {
        inMultilineComment = false;
      }
      continue;
    }

    // Check for start of a multi-line comment
    if (line.startsWith('/*')) {
      inMultilineComment = true;
      if (!line.includes('*/')) {
        continue;
      }
      inMultilineComment = false;
      continue;
    }

    if (line.startsWith('//')) {
      continue;
    }

    const match = line.match(/^\s*(class|\bpublic\s+class)\s+(\$?[A-Za-z_]\w*)\b\s*(extends\s*\w+)?\s{/);
    if (match) {
      runnableClasses.push(match[2]);
    }
  }

  if (!runnableClasses && !error) {
    error = 'No public class found in the file.';
  }

  if (runnableClasses.length === 0) return 'Main';

  if (runnableClasses.includes('Main')) return 'Main';

  return runnableClasses[0];
}

