function processCarriageReturn(str) {
  const traversed = [];
  const chunks = str.split('\r');

  for (let chunk of chunks) {
    chunk.split('').forEach((letter, index) => {
      traversed[index] = letter;
    });
  }

  return traversed.join('');
}

function connect(socketUrl) {
  socket = io(socketUrl, {
    // We explicitly need to specify websocket here to stop the socket io library
    // from using longpolling since we are distributing the load across different
    // nodes using Kubernetes.
    // https://socket.io/docs/using-multiple-nodes/
    transports: ['websocket'],
  });

  const replaceLoaderWtihText = () => {
    $('.mobile-run-button #loader').replaceWith(runButtonText);
    $('.desktop-run-button #loader').replaceWith(runButtonText);
    $('.mobile-top-bar-run-button').html(`<img
      src="https://cdn.playground-v2.programiz.com/assets/icons/play.svg" alt="run-icon"
    />`);
  };

  const enableRunButton = () => {
    replaceLoaderWtihText();
    $('.desktop-run-button').attr('disabled', false);

    $('.desktop-run-button').css({
      cursor: 'pointer',
    });
  };

  let outputBuffer = '',
    timer = null;

  function debounce(func, delay) {
    return function (...args) {
      clearTimeout(timer);
      timer = setTimeout(() => {
        func.apply(this, args);
      }, delay);
    };
  }

  const writeToTerminal = debounce((value) => {
    const lines = value.split('\r\n');
    const modifiedLines = lines.map((line) => processCarriageReturn(line)).join('\n');

    terminalEditor.setValue(modifiedLines, 1);
    lastValue = terminalEditor.getValue();
    terminalEditor.focus();
  }, 80);

  socket.on('output', ({ output }) => {
    enableRunButton();

    outputBuffer += output;
    writeToTerminal(outputBuffer);
  });

  socket.on('disconnect', (reason) => {
    console.log(`Disconnected: ${reason}`);

    if (!isRunningOnIOS()) {
      if (reason === 'ping timeout' || reason === 'transport close') {
        const value = terminalEditor.getValue() + '\n=== Session Ended. Please Run the code again ===';

        writeToTerminal(value, 1);
        socket.disconnect();
      }
    }
    enableRunButton();
    outputBuffer = '';

    // Hide the cursor after execution ends
    // wait for the output buffer to be fully written to the terminal
    setTimeout(() => {
      terminalEditor.blur();
      $('#terminal .ace_hidden-cursors .ace_cursor').hide();
    }, 500);
  });

  socket.on('connect', function () {
    terminalEditor.setValue(lastValue, 1);
    if (!Object.values(SUPPORTED_LANGUAGES).includes(client_lang)) {
      alert(`This language is not supported, initializing ${DEFAULT_LANGUAGE} instead`);
    }
  });
}

