function toggleSaleBanner() {
  // Get time from data-end-time property of #sale-time-countdown
  let endDate = new Date($('#sale-time-countdown').data('end-time'));

  // If endDate is not a valid date or if the endDate is in the past, return
  if (!endDate || new Date() > endDate) {
    return;
  }

  createFixedBarTimer(new Date(endDate).getTime());

  $('#sale-top-banner .sale-top-banner__title').removeClass('d-none');
}

function createFixedBarTimer(endDateInMilliseconds) {
  showTimer();

  const x = setInterval(showTimer, 1000);

  function showTimer() {
    let now = new Date().getTime();

    const distance = endDateInMilliseconds - now;

    let days = Math.floor(distance / (1000 * 60 * 60 * 24));
    let hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
    let minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
    let seconds = Math.floor((distance % (1000 * 60)) / 1000);

    if (now > endDateInMilliseconds) {
      days = 0;
      hours = 0;
      minutes = 0;
      seconds = 0;

      clearInterval(x);
    }

    if (days < 10) {
      days = '0' + days;
    }

    if (hours < 10) {
      hours = '0' + hours;
    }

    if (minutes < 10) {
      minutes = '0' + minutes;
    }

    if (seconds < 10) {
      seconds = '0' + seconds;
    }

    $('#sale-time-countdown').html(days + 'd : ' + hours + 'hrs : ' + minutes + 'mins : ' + seconds + 's');
  }
}

// Show sale banner after 10 seconds of load
setTimeout(() => {
  toggleSaleBanner();
}, 3000);

$('.sale-top-banner__close-btn').on('click', function (e) {
  e.stopPropagation();
  e.preventDefault();

  $('#sale-top-banner').addClass('d-none');
});


